import React from "react";
import "./StartPage.scss";

const StartPage = () => {
   return <div className="start-page">
      <h1>Welcome to Matrix Builder</h1>
      <label for='rows-count'>Set the rows count</label>
      <input type='number' id='rows-count'></input>
      <label for='columns-count'>Set the columns count</label>
      <input type='number' id='columns-count'></input>
      <label for='cells-count'>Set the count of cells to show the nearest value</label>
      <input type='number' id='cells-count'></input>
   </div>;
};

export default StartPage;
